import React, { Component } from 'react';

class TableRowSearch extends Component {
    render() {
        return (
            <tr>  
                <td>
                    {this.props.obj.document}
                </td>
                
                <td>
                    {this.props.obj.message}                   
                </td>
                
            </tr>
        );
    }
}

export default TableRowSearch;
